import React, { Component } from "react";

export default class Menu extends Component {
  render() {
    return (
      <div>
        <div className="menu_box">
          <ul>
            <li>The Initiative</li>
            <li>The Original Six</li>
            <li>Become An Avenger</li>
          </ul>
        </div>
      </div>
    );
  }
}
